        // }

        return (
                <div className='new-message-container' onClick={closeNewMessageWindow}>
                        <div className='new-message-window'>
                                <div className='new-message-internals'>
                                        <h3>New Message</h3>
                                        <textarea
                                                type="text" 
                                                name="message"  
                                                maxLength="10000"
                                        />
                                        <div className='submit-button'>
                                                <button>Submit</button>
                                        </div>
                                </div>
                        </div>
                </div>
        )
}

export default NewMessage
